package com.papitomarket.model.cache;

public class Cache {
	private long id;
	private String url;
	private String cache;

	public Cache(long id, String url, String cache) {
		super();
		this.id = id;
		this.url = url;
		this.cache = cache;
	}

	public long getId() {
		return id;
	}

	public void setId(long id) {
		this.id = id;
	}

	public String getUrl() {
		return url;
	}

	public void setUrl(String url) {
		this.url = url;
	}

	public String getCache() {
		return cache;
	}

	public void setCache(String cache) {
		this.cache = cache;
	}
}
